import ApiService from '../../../services/api.service'

const state = {
    // dados para sincronização ...
    store: {
        name: 'ProducaoIdelli',
        route: 'ProducaoIdelli/SequenciaProducao_PartList/Select',
        getter: 'gtxpartlist',
        setter: 'setpartlist',
        action: 'actpartlist'
    },

    partlist: {
        selected: null,
        loading: false,
        apiresponse: null,
        data: [],
        update: [],
        StatusKappes: [
            {value: 1, text: 'Repasse'},
            {value: 2, text: 'Cortado Novo'},
            {value: 3, text: 'Borda Refeita'},
            {value: 4, text: 'Falha na Chapa'}
        ]
    },

    simulaproducao: {
        selected: null,
        loading: false,
        apiresponse: null,
        data: []        
    }
}

const getters = {
    
    
    gtxpartlistresponse: state => state.partlist.apiresponse,
    gtxpartlist: state => state.partlist.data || [],
    gtxpartlistdata: state => state.partlist.apiresponse.Data || [],
    gtxpartlistStatusKappes: state => state.partlist.StatusKappes,
    gtxpartlistupdate: state => state.partlist.update || [],
    gtxpartlistloading: state => state.partlist.loading || false,
    
    gtxsimulaproducaoresponse: state => state.simulaproducao.apiresponse,
    gtxsimulaproducao: state => state.simulaproducao.data || [],
    gtxsimulaproducaodata: state => (state.simulaproducao.apiresponse) ? state.simulaproducao.apiresponse.Data : []

}

const mutations = {

    setpartlistresponse: (state, data) => state.partlist.apiresponse = data,
    
    setpartlist: (state, data) => state.partlist.data = data,

    setpartlistStatusKappes: (state, data) => state.partlist.StatusKappes = data,
    
    setpartlistloading: (state, load) => state.partlist.loading = load,
    
    setsimulaproducaoresponse: (state, data) => state.simulaproducao.apiresponse = data,

    setsimulaproducao: (state, data) => state.simulaproducao.data = data,

    setpartlistupdate: (state, update) => state.partlist.update = update

}

const actions = {

    actpartlist: ({ commit }, params) => {

        commit('setpartlistloading', true)
        ApiService.setAuthHeader()
        ApiService.get('ProducaoIdelli/SequenciaProducao_PartList/Select', params)
            .then(data => {
                // console.log('setsimulaproducaoresponse.get.params:', params)
                // console.log('setsimulaproducaoresponse.get:', data)

                commit('setpartlistresponse', data.data)
                commit('setpartlist', data.data.Data || [])
                commit('setpartlistloading', false)
            })

    },

    actpartlistStatusKappes: ({ commit }, params) => {

        ApiService.setAuthHeader()
        ApiService.get('ProducaoIdelli/SequenciaProducao_Partlist/StatusKappes', params)
            .then(data => {
                // console.log('setsimulaproducaoresponse.get.params:', params)
                // console.log('actpartlistStatusKappes.get:', data)
                commit('setpartlistStatusKappes', data.data.Data || [])
            })

    },

    actsimulaproducao: ({ commit }, payload) => {

        const params = {
            params: payload
        }

        // console.log('partlist.actpartlist:hit')

        ApiService.setAuthHeader()
        ApiService.get('Producao/Lotes/SimulacaoDetalhes', params)
            .then(data => {
                console.log('actsimulaproducao.get.params:', params)
                console.log('actsimulaproducao.get:', data)

                commit('setsimulaproducaoresponse', data.data)
                commit('setsimulaproducao', data.data.Data || [])

            })

    },

    actpartlistupdate: ({ commit }, update) => {

        const params = {
            barcode: update.barcode || '',
            StatusKappes: update.StatusKappes
        }

        // console.log('partlist.actpartlist:hit')

        ApiService.setAuthHeader()
        ApiService.post('ProducaoIdelli/SequenciaProducao_PartList/StatusKappesUpdate', params)
            .then(data => {
                // console.log('partlist.actpartlistupdate.post.params:', params)
                // console.log('partlist.actpartlistupdate.post:', data)

                commit('setpartlistupdate', data.data)
            })

    }
}


export default { state, mutations, getters, actions }
